import React, { useState } from 'react'
import axios from 'axios'



function App() {

  let initialCurrencies = {}


  const [currencies, setCurrencies] = useState(initialCurrencies)


  const getMarketData = () => {
      axios
        .get('https://api.coingecko.com/api/v3/global')
        .then(res => {
        //  console.log(res.data.data)
        const indivCurrencies = res.data.data;
        console.log(indivCurrencies);
        setCurrencies(indivCurrencies)

        }).catch(error => {
          console.log(error);
        });
      }



  return (
    <div >
     <button onClick={getMarketData}>Get Currency Data</button>
      <h1>Active Crypto Currencies: {currencies.active_cryptocurrencies}</h1>
      <h2>Market Cap Change Percentage (24HRS): {currencies.market_cap_change_percentage_24h_usd}</h2>
      <h2>Markets: {currencies.markets}</h2>
      <h2>Ongoing Initial Coin Offering: {currencies.ongoing_icos}</h2>
      <h1>Ended InitialCoin Offering: {currencies.ended_icos}</h1>
      <h2>Upcoming Initial Coin Offering: {currencies.upcoming_icos}</h2>

    </div>
  );
}

export default App;
